import {StyleSheet} from 'react-native';
export default StyleSheet.create({
  deliveryContainer: {
    padding: 10,
    flexDirection: 'row',
  },
  locationContainer: {
    marginRight: 15,
  },
  locationImage: {
    width: 90,
    height: 90,
    borderRadius: 10,
  },
  locationInfo: {
    marginBottom: 10,
  },
  deliveryTime: {
    marginBottom: 10,
  },
  deliveryTimeContainer: {
    padding: 10,
    flexDirection: 'row',
    justifyContent: 'space-between',
  },
  changeTimeContainer: {
    justifyContent: 'center',
  },
  dateTimePicker: {
    margin: 10,
  },
});
